void sieve()
{
	for (int i=0;i<P_MAX+1;i++)
	{
		er[i]=i >= 2;
	}
	for (int i=2;i*i<=P_MAX;i++)
	{
		if (er[i])
		{
			for (int j=i*i;j<=P_MAX;j+=i)
			{
				er[j]=false;
			}
		}
	}
}
int main()
{
	sieve();
	int np[10000];
	int sum=0,sq=1;
	for (int i=0;i<P_MAX;i++)
	{
		if (er[i])
		{
			sum++;
		}
		if (sq*sq==i)
		{
			np[sq++]=sum;
		}
	}
	sum=0;
	for (int i=0;i<EMB_MAX;i++)
	{
		np[i+1000]=(sum+=emb[i]);
	}
	int T;
	scanf("%d",&T);
	for (int t=1;t<=T;t++)
	{
		int n;
		scanf("%d",&n);
		printf("Case %d: %d\n",t,np[n]);
	}
	return 0;
}
